import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

function HandelScroll(e){
  console.log(e)
  console.log(e.target)
}

ReactDOM.render(
  <React.StrictMode>
  <App onScroll={HandelScroll} />

  </React.StrictMode>,
  document.getElementById('root')
);
